body:
Some PNG images have long `iTXt` chunks so the parser never reaches `IDAT` chunk.

When printing chunks after the header, I get something like this:
```
{ length: 13, type: 'IHDR' }
{ length: 9, type: 'pHYs' }
{ length: 25204, type: 'iTXt' }
```

A solution perhaps would be to add a final return after [this line](https://github.com/sindresorhus/file-type/blob/master/core.js#L887) in case the PNG header matches, but no `IDAT` chunk is found in first 4100 bytes. Or perhaps an extra switch case for `ITXt` chunk?

Example image with `ITXt` chunk: https://puu.sh/F4fqT.png

