This was surprising to me. Apparently the following code contains a race condition:

```js
let totalLength = 0;

async function addLengthOfSinglePage(pageNum) {
  totalLength += await getPageLength(pageNum);
}

Promise.all([addLengthOfSinglePage(1), addLengthOfSinglePage(2)]).then(() => {
  console.log('The combined length of both pages is', totalLength);
});
```

Ecosystem impact: Only one repo failed. Looks to be a false positive. Reported here: https://github.com/eslint/eslint/issues/11954 This carries some amount of false positive risk (at least based on what I've seen on the eslint tracker). I'd like to enable this in `standard` 13 and see how it goes. We can relax this rule if there are too many false positives.

