## Please describe the **minimum necessary steps** to reproduce this issue:

```js
const micromatch = require('micromatch'); // version must be >= 4.0.1
console.log(micromatch(['/test/t/'], ['**/t/']));
// [ '/test/t/' ]
console.log(micromatch(['/test/t/'], ['**/t']));
// []

const nm = require('nanomatch');
console.log(nm(['/test/t/'], ['**/t/']));
// [ '/test/t/' ]
console.log(nm(['/test/t/'], ['**/t']));
// [ '/test/t/' ]
```

## What is happening:

`micromatch` takes into account the trailing slash and do an exact match
`nanomatch` doesn't take it into account and match even without trailing slash in the pattern

## What should be happening instead?

Both libraries should be aligned on this behaviour. From this [previous issue on micromatch](https://github.com/micromatch/micromatch/issues/128) about trailing slashes, I believe we will want the fix to be done here in nanomatch.

## Additional info

As `micromatch` switched from `nanomatch` to `picomatch` in v4.x (during [this refactor](https://github.com/micromatch/micromatch/commit/52df06d08c2cd41b8ded6f30a1d7e69dde89b8ca#diff-b9cfc7f2cdf78a7f4b91a753d10865a2R39)), `micromatch`'s behaviour has actually changed between `v3.1.10` and `v4.0.1`. It was previously behaving like `nanomatch`.
Again, after reading the discussion about the trailing slashes linked above, I believe we want to keep its new behaviour, so an additional unit test could be added in micromatch to be sure to stay consistent in the future.

