Hi, I found a weird bug.

Redux package version is 4.0.1.

So I have two somewhat identical arrays in my initial state:
```
{
   items: [],
   userItems: []
}
```

Brief explanation why I have these two, both of them are array of objects, they contain similar keys such as id, name and checked. "items" is more of a reference to the "userItems", and "userItems" is the user's preference to the "items". I separated them so that when the user logs out, I only have to clear the "userItems" but retain the "items" so I can reference it again when another user logs in.

Here's how the structure looks like with data.
```
{
   items: [{
      id: 2,
      order: 1,
      name: "xxx",
      title: "xxx",
      description: "xxx",
      checked: false // This can be true or false if server wants them pre-checked when user registers
   },
   ...
   ],
   userItems: [{
      id: 2,
      name: "xxx",
      checked: true
   },
   ...
   ],
}
```

I have a reducer called `USER_NEWSLETTERS_UPDATE`:


